    false,nt"url": null,nt"notes": "NCEI Accession 0155988 includes physical,
    profile and underway data collected aboard the ROGER REVELLE during cruise RR1601
    in the East China Sea (Tung Hai) and Philippine Sea from 2016-01-14 to 2016-01-19.
    These data include CONDUCTIVITY, CURRENT SPEED - EAST/WEST COMPONENT (U), CURRENT
    SPEED - NORTH/SOUTH COMPONENT (V), SALINITY and WATER TEMPERATURE. The instruments
    used to collect these data include ADCP, CTD and GPS. These data were collected
    by University of California - San Diego; Scripps Institution of Oceanography as
    part of Winch Test. The Lamont-Doherty Earth Observatory (LDEO) submitted these
    data to NCEI as part of the NSF sponsored Rolling Deck to Repository (R2R) program.nnThe
    ADCP data represent the raw and automated processed data set. Post processed quality
    assessed data are not available in this accession.",nt"license_title": null,nt"extras":
